class editablecell extends Component {
    render() {
        return (
            <td>
                <input type="text" name={this.props.cellData.type} id={this.props.cellData.id}  onChange={this.props.onProductTableUpdate} style={{width:'100%'}}/>
            </td>
        );
    }
}

export default editablecell;
